function removeElement(e){if(document.getElementById(e)){var t=document.getElementById(e);return t.parentNode.removeChild(t)}}function removeElementAndChilds(e){if(document.getElementById(e)){const t=document.getElementById(e);for(;t.firstChild;)t.removeChild(t.firstChild)}}function getFormattedDate(e){var t=e.getFullYear(),n=(1+e.getMonth()).toString();n=n.length>1?n:"0"+n;var o=e.getDate().toString();return(o=o.length>1?o:"0"+o)+"/"+n+"/"+t}function parseDate(e){var t=e.split("/");return console.log(t),new Date(t[0],t[1]-1,t[2]).toString().toDateString()}function addElement(e,t,n){if(document.getElementById(e)){var o=document.getElementById(e),d=document.createElement(t);d.setAttribute("id",n),o.appendChild(d)}}function showElement(e){document.getElementById(e).style.display="block"}function hideElement(e){document.getElementById(e).style.display="none"}function hex2dec(e){return parseInt(e,16)}